import React, { useEffect, useState } from "react";
import axios from "axios";

function Fetch() {
  const [maa, setMaa] = useState([]);

  useEffect(() => {
    const url = "https://restcountries.com/v3.1/all";
    axios.get(url).then((res) => {
      setMaa(res.data);
    });
  }, [url]);

  return maa
}

export default Fetch;
